// App.js
import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import AboutMobiles from './AboutMobiles';
import Brand1 from './brand1';
// import Brand2 from './brand2';
// import Brand3 from './brand3';

const App = () => {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/brand1" component={Brand1} />
          {/* <Route path="/brand2" component={Brand2} />
          <Route path="/brand3" component={Brand3} /> */}
          <Route path="/" component={AboutMobiles} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
